import * as React from 'react';
import { extendTheme, styled } from '@mui/material/styles';
import DashboardIcon from '@mui/icons-material/Dashboard';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import BarChartIcon from '@mui/icons-material/BarChart';
import DescriptionIcon from '@mui/icons-material/Description';
import LayersIcon from '@mui/icons-material/Layers';
import { AppProvider } from '@toolpad/core/AppProvider';
import { DashboardLayout } from '@toolpad/core/DashboardLayout';
import { PageContainer } from '@toolpad/core/PageContainer';
import Grid from '@mui/material/Grid';
import { getAllTickets } from './authService';

const NAVIGATION = [
  {
    kind: 'header',
    title: 'Main items',
  },
  {
    segment: 'dashboard',
    title: 'Tickets',
    icon: <DashboardIcon />,
  },
  {
    segment: 'orders',
    title: 'Create',
    icon: <ShoppingCartIcon />,
  },
  {
    kind: 'divider',
  },
  {
    kind: 'header',
    title: 'Billing',
  },
  {
    segment: 'reports',
    title: 'Invoices',
    icon: <BarChartIcon />,
    children: [
      {
        segment: 'sales',
        title: 'Open',
        icon: <DescriptionIcon />,
      },
      {
        segment: 'traffic',
        title: 'Closed',
        icon: <DescriptionIcon />,
      },
    ],
  },
  {
    segment: 'integrations',
    title: 'Ping',
    icon: <LayersIcon />,
  },
];

const demoTheme = extendTheme({
  colorSchemes: { light: true, dark: true },
  colorSchemeSelector: 'class',
  breakpoints: {
    values: {
      xs: 0,
      sm: 600,
      md: 600,
      lg: 1200,
      xl: 1536,
    },
  },
});

function useDemoRouter(initialPath) {
  const [pathname, setPathname] = React.useState(initialPath);

  const router = React.useMemo(() => {
    return {
      pathname,
      searchParams: new URLSearchParams(),
      navigate: (path) => setPathname(String(path)),
    };
  }, [pathname]);

  return router;
}

const Skeleton = styled('div')(({ theme, height }) => ({
  backgroundColor: theme.palette.action.hover,
  borderRadius: theme.shape.borderRadius,
  height,
  content: '" "',
}));

export default function DashboardLayoutBasic(props) {
  const { window } = props;
  const router = useDemoRouter('/dashboard');
  const demoWindow = window ? window() : undefined;

  const [tickets, setTickets] = React.useState([]);
  const [loading, setLoading] = React.useState(true);

  // Fetch tickets when component mounts
  React.useEffect(() => {
    const fetchTickets = async () => {
      try {
        const data = await getAllTickets();
        setTickets(data); // Store fetched tickets
      } catch (error) {
        console.error('Failed to fetch tickets:', error.message);
      } finally {
        setLoading(false);
      }
    };

    if (router.pathname === '/dashboard') {
      fetchTickets();
    }
  }, [router.pathname]);

  return (
    <AppProvider navigation={NAVIGATION} router={router} theme={demoTheme} window={demoWindow}>
      <DashboardLayout>
        <PageContainer>
          <Grid container spacing={1}>
            {router.pathname === '/dashboard' ? (
              <>
                <Grid item xs={12}>
                  <h2>Tickets</h2>
                </Grid>
                <Grid item xs={12}>
                  {loading ? (
                    <p>Loading tickets...</p>
                  ) : tickets.length > 0 ? (
                    <ul>
                      {tickets.map((ticket) => (
                        <li key={ticket.id}>
                          <strong>Ticket ID:</strong> {ticket.id} | <strong>Status:</strong> {ticket.ticketStatus} | <strong>Assignee:</strong> {ticket.assignee?.firstName} {ticket.assignee?.lastName}
                        </li>
                      ))}
                    </ul>
                  ) : (
                    <p>No tickets available.</p>
                  )}
                </Grid>
              </>
            ) : (
              <>
                {/* Default placeholder content */}
              </>
            )}
          </Grid>
        </PageContainer>
      </DashboardLayout>
    </AppProvider>
  );
}
